package com.bms.model;

public class AwardModel  {
	private Integer awardId;
	private String awardName;
	private String awardTime;
	private Integer userId;
	private String userName;
	private String state = "未兑换";
	public AwardModel() {
		super();
		// TODO Auto-generated constructor stub
	}
	public AwardModel(Integer awardId, String awardName, String awardTime, Integer userId, String userName,
			String state) {
		super();
		this.awardId = awardId;
		this.awardName = awardName;
		this.awardTime = awardTime;
		this.userId = userId;
		this.userName = userName;
		this.state = state;
	}
	public Integer getAwardId() {
		return awardId;
	}
	public void setAwardId(Integer awardId) {
		this.awardId = awardId;
	}
	public String getAwardName() {
		return awardName;
	}
	public void setAwardName(String awardName) {
		this.awardName = awardName;
	}
	public String getAwardTime() {
		return awardTime;
	}
	public void setAwardTime(String awardTime) {
		this.awardTime = awardTime;
	}
	public Integer getUserId() {
		return userId;
	}
	public void setUserId(Integer userId) {
		this.userId = userId;
	}
	public String getUserName() {
		return userName;
	}
	public void setUserName(String userName) {
		this.userName = userName;
	}
	public String getState() {
		return state;
	}
	public void setState(String state) {
		this.state = state;
	}
	@Override
	public String toString() {
		return "AwardModel [awardId=" + awardId + ", awardName=" + awardName + ", awardTime=" + awardTime + ", userId="
				+ userId + ", userName=" + userName + ", state=" + state + "]";
	}
	
	
	
}
